            }})}
    const [user, setuser] = useState(null);
    const [pass, setPass] = useState(null);
    const [npass, setpass] = useState(null);
    const [err, seterr] = useState('');

    return (
        <View style={styles.container}>
            <View style={styles.head}>
                <Text style={{ fontSize: 30 }}>Update Your Password</Text>
            </View>
            <View style={styles.inus}>
                <View style={styles.left}>
                <View style={styles.icon}>
                        <Image
                            style={{
                                width: 40,
                                height: 40,
                                resizeMode: 'stretch',
                                marginTop: 30,
                                marginLeft: 5
                            }}
                            source={require('./icons/user.png')}
                        /></View>
                    <View style={styles.icon}>
                        <Image
                            style={{
                                width: 40,
                                height: 40,
                                resizeMode: 'stretch',
                                marginTop: 10,
                                marginLeft: 5
                            }}
                            source={require('./icons/pass.png')}
                        /></View>
                    <View style={styles.icon}>
                        <Image
                            style={{
                                width: 40,
                                height: 40,
                                resizeMode: 'stretch',
                               
                                marginLeft: 5,
                            }}
                            source={require('./icons/pass.png')}
                        /></View>
                </View>
                <View style={styles.right}>
                <TextInput
                        style={styles.textinput}

                        placeholder="enter your corrcet username"
                        value={user}
                        onChangeText={setuser}
                    />
                    <TextInput
                        style={styles.textinput}

                        placeholder="enter your corrcet password"
                        value={pass}
                        onChangeText={setPass}
                    />

                    <TextInput
                        style={styles.textinput}
                        placeholder="new password"
                        secureTextEntry={true}
                        value={npass}
                        onChangeText={setpass}
                    />
                </View>
            </View>
            <Text style={{ color: "red" }}>                             {err}</Text>
            <TouchableOpacity style={styles.ButtonLogin}>
                <Text
                    style={{ color: '#fff', fontSize: 25 }}
                    onPress={Update}>
                    Update
                </Text>
            </TouchableOpacity>
            <View style={styles.ButtonLogin1}>
                        <TouchableOpacity onPress={() => navigation.navigate('Login')}>
                            <Text style={{ color: '#fff', fontSize: 25 }}>
                                Logout
                            </Text>
                        </TouchableOpacity>
                    </View>
        </View>
    )
}

